CREATE TABLE PEDIDO_TBL
(
	NUM_PEDIDO 	INT NOT NULL,
	CODCLI 		INT NULL,
	CODVEN 		SMALLINT NULL,
	DATA_EMISSAO 	DATETIME NULL,
	VLR_TOTAL 	NUMERIC(18, 2) NULL,
	SITUACAO 	VARCHAR(1) NULL,
	OBSERVACOES 	TEXT NULL,
 PRIMARY KEY CLUSTERED (NUM_PEDIDO ASC) ON [PRIMARY],
 FOREIGN KEY (CODCLI) REFERENCES CLIENTE_TBL(CODCLI),
 FOREIGN KEY (CODVEN) REFERENCES VENDEDOR_TBL(CODVEN)
 );

